import{_ as e,o as t,c as o,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 30-34.6 Printing and distribution of Journals of Senate and House.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/30-34.6.md","filePath":"vacode/30-34.6.md"}'),n={name:"vacode/30-34.6.md"},a=i('<h1 id="§-30-34-6-printing-and-distribution-of-journals-of-senate-and-house" tabindex="-1">§ 30-34.6 Printing and distribution of Journals of Senate and House. <a class="header-anchor" href="#§-30-34-6-printing-and-distribution-of-journals-of-senate-and-house" aria-label="Permalink to &quot;§ 30-34.6 Printing and distribution of Journals of Senate and House.&quot;">​</a></h1><p>A. The Commission, through the Division of Legislative Automated Systems, shall order all printing done by direction of the Senate or the House of Delegates, or their respective clerks. Within a reasonable time after the close of each session of the General Assembly the Commission shall cause to be printed and bound the Journals of the Senate and the House of Delegates, with an index thereto, in sufficient quantity to make the following distribution, if requested pursuant to § <a href="/vacode/30-34.4:1/">30-34.4:1</a>:</p><ol><li><p>One copy to the Governor;</p></li><li><p>Fifteen copies each to the Clerk of the Senate and the Clerk of the House;</p></li><li><p>A sufficient number of copies to The Library of Virginia to meet collection requirements pursuant to § <a href="/vacode/2.2-609/">2.2-609</a>;</p></li><li><p>One copy to the library of each educational institution in this Commonwealth;</p></li><li><p>One copy to each public library which makes written application therefor to the Commission;</p></li><li><p>One copy to the President of the Senate and one copy to the Speaker of the House;</p></li><li><p>One copy to the Division of Legislative Services;</p></li><li><p>One copy to each requesting member of the Senate and the House of Delegates;</p></li><li><p>One copy to the Joint Legislative Audit and Review Commission;</p></li><li><p>One copy to the Committee on Appropriations of the House of Delegates; and</p></li><li><p>One copy to the Senate Committee on Finance and Appropriations.</p></li></ol><p>B. The number of copies to be printed and the quality of binding shall be designated by the Commission.</p><p>1980, c. 687; 1987, cc. 123, 128; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0064" target="_blank" rel="noreferrer">64</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0264" target="_blank" rel="noreferrer">264</a>.</p>',5),r=[a];function s(l,p,h,c,d,f){return t(),o("div",null,r)}const _=e(n,[["render",s]]);export{m as __pageData,_ as default};
